// components/Transactions/TransactionMenu.js

import React from 'react';
import { Link } from 'react-router-dom';
import './TransactionMenu.css';

const TransactionMenu = () => {
  return (
    <div className="transaction-menu">
      <h2>Gestión de Transacciones</h2>
      <div className="menu-buttons">
        <Link to="/transactions/create" className="menu-button">Crear Transacción</Link>
        <Link to="/transactions/list" className="menu-button">Lista de Transacciones</Link>
      </div>
    </div>
  );
};

export default TransactionMenu;
